import './App.css'
import MainDash from './components/MainDash/MainDash';
import RightSide from './components/RigtSide/RightSide';
import Sidebar from './components/Sidebar';

function App() {
  return (
       <Router>
      <div className="App">
        <div className="AppGlass">
          <Sidebar/>
          <Switch>
          <MainDash />
          </Switch>
          <RightSide/>
        </div>
      </div>
    </Router>
  );
}


export default App;
